        }
    }

    bool ShowUnConfirmedReservationIcon(ReservationEvent reservation)
    {
        if (reservation.CanUserMakeReservation && reservation.ReservationPeriods.Any(x => x.ReservationMade && x.IsConfirmed == false))
        {
            return true;
        }

        return false;
    }
